class ChirpChannel {
  location = 0;
  Name = "";
  Frequency = "";
  Duplex = "";
  Offset = "";
  Tone = "";
  rToneFreq = "";
  cToneFreq = "";
  DtcsCode = "";
  DtcsPolarity = "";
  RxDtcsCode = "";
  CrossMode = "";
  Mode = "";
  TStep = "";
  Skip = "";
  Power = "";
  Name = "";

  constructor(index, vals) {
    this.index = index;
    this.vals = vals;

    for (var i = 0; i < this.index.length; i++) {
      switch (this.index[i].toLowerCase()) {
        case "location":
          this.location = vals[i];
          break;
        case "name":
          this.Name = vals[i];
          break;
        case "frequency":
          this.Frequency = vals[i];
          break;
        case "duplex":
          this.Duplex = vals[i];
          break;
        case "offset":
          this.Offset = vals[i];
          break;
        case "tone":
          this.Tone = vals[i];
          break;
        case "rtonefreq":
          this.rToneFreq = vals[i];
          break;
        case "ctonefreq":
          this.cToneFreq = vals[i];
          break;
        case "dtcscode":
          this.DtcsCode = vals[i];
          break;
        case "dtcspolarity":
          this.DtcsPolarity = vals[i];
          break;
        case "rxdtcscode":
          this.RxDtcsCode = vals[i];
          break;
        case "crossmode":
          this.CrossMode = vals[i];
          break;
        case "mode":
          this.sqMode = vals[i];
          break;
        case "tstep":
          this.TStep = vals[i];
          break;
        case "skip":
          this.Skip = vals[i];
          break;
        case "power":
          this.Power = vals[i];
          break;
        case "name":
          this.Name = vals[i];
          break;
      }
    }
  }
}

class UV17Channel {
  id = 0;
  rxFreq = "";
  strRxCtsDcs = "";
  txFreq = "";
  strTxCtsDcs = "";
  busyLock = 0;
  txPower = 0;
  bandwide = 0;
  scanAdd = 0;
  sqMode = 0;
  pttid = 0;
  signalGroup = 0;
  fhss = 0;
  cName = "";

  chanIndex = 185;
  strIndex = 1738;

  constructor(chanIndex = 0, strIndex = 0) {
    this.chanIndex = chanIndex;
    this.strIndex = strIndex;
  }

  loadFromChirpChannel(ChirpChannel) {
    this.id = ChirpChannel.location;
    this.rxFreq = this.formatFreq(ChirpChannel.Frequency);

    // Calculate tx
    let duplex = ChirpChannel.Duplex;
    let offset = ChirpChannel.Offset;

    //Defaults to split
    this.txFreq = this.rxFreq;

    if (Number(offset) != 0) {
      switch (duplex) {
        case "-":
          this.txFreq = parseFloat(this.rxFreq) - parseFloat(offset);
          break;
        case "+":
          this.txFreq = parseFloat(this.rxFreq) + parseFloat(offset);
        //case "":
        //this.txFreq = "";
        //break;
      }
    }

    //Format tx
    this.txFreq = this.formatFreq(this.txFreq);

    // Calculate QT/DQT
    let rxDigital = false;
    let txDigital = false;

    switch (String(ChirpChannel.Tone).toLowerCase()) {
      case "tone":
        this.strTxCtsDcs = ChirpChannel.rToneFreq;
        break;
      case "tsql":
        this.strTxCtsDcs = ChirpChannel.cToneFreq;
        this.strRxCtsDcs = ChirpChannel.cToneFreq;
        break;
      case "dtcs":
        this.strTxCtsDcs = ChirpChannel.DtcsCode;
        this.strRxCtsDcs = ChirpChannel.DtcsCode;
        rxDigital = true;
        txDigital = true;
        break;
      case "dtcs-r":
        this.strRxCtsDcs = ChirpChannel.rxDTCStone;
        rxDigital = true;
        break;
      case "tsql-r":
        this.strRxCtsDcs = ChirpChannel.cToneFreq;
        break;
      case "cross":
        switch (String(ChirpChannel.CrossMode).toLowerCase()) {
          case "tone->tone":
            this.strTxCtsDcs = ChirpChannel.rToneFreq;
            this.strRxCtsDcs = ChirpChannel.cToneFreq;
            alert("");
            break;
          case "tone->dtcs":
            this.strTxCtsDcs = ChirpChannel.rToneFreq;
            this.strRxCtsDcs = ChirpChannel.rxDTCStone;
            rxDigital = true;

            break;
          case "dtcs->tone":
            this.strTxCtsDcs = ChirpChannel.DtcsCode;
            this.strRxCtsDcs = ChirpChannel.cToneFreq;
            txDigital = true;
            break;
          case "->tone":
            this.strRxCtsDcs = ChirpChannel.cToneFreq;
            break;
          case "->dtcs":
            this.strRxCtsDcs = ChirpChannel.rxDTCStone;
            rxDigital = true;
            break;
          case "dtcs->":
            this.strTxCtsDcs = ChirpChannel.DtcsCode;
            txDigital = true;
            break;
          case "dtcs->dtcs":
            this.strTxCtsDcs = ChirpChannel.DtcsCode;
            this.strRxCtsDcs = ChirpChannel.rxDTCStone;
            rxDigital = true;
            txDigital = true;
            break;
          default:
            break;
        }
        break;

      default:
        this.strRxCtsDcs = "";
        this.strTxCtsDcs = "";
        break;
    }

    //format digital
    if (ChirpChannel.DtcsPolarity != "") {
      if (txDigital) {
        if (ChirpChannel.DtcsPolarity.charAt(0).toLowerCase() == "n") {
          this.strTxCtsDcs = "D" + this.strTxCtsDcs + "N";
        } else {
          this.strTxCtsDcs = "D" + this.strTxCtsDcs + "I";
        }
      }
      if (rxDigital) {
        if (ChirpChannel.DtcsPolarity.charAt(0).toLowerCase() == "n") {
          this.strRxCtsDcs = "D" + this.strRxCtsDcs + "N";
        } else {
          this.strRxCtsDcs = "D" + this.strRxCtsDcs + "I";
        }
      }
    }

    this.cName = ChirpChannel.Name;

    if (ChirpChannel.Mode == "NFM") {
      this.bandwide = 1;
    }

    if (ChirpChannel.Skip == "S") {
      this.scanAdd = 1;
    }
  }

  getChannelBuffer() {
    let id_AB = this.createID(); //new ArrayBuffer(13); //  Id – 2E 00 00 00 00 00 00 00 06 94 08 00 00 (increments by 5 – example 94 08 to 99 08)
    let rxFreq_AB = this.bytesFromString(this.rxFreq, "freq"); //  rxFreq - (string) 09 – 123.45678 (ends with 09 AF)
    let strRxCtsDcs_AB = this.bytesFromString(this.strRxCtsDcs, "ctsdcs"); // strRxCtsDcs (string) 05 – D754I
    let txFreq_AB = this.bytesFromString(this.txFreq, "freq"); // txFreq - (string) 09 – 123.45678 (ends with 09 AF)
    let strTxCtsDcs_AB = this.bytesFromString(this.strTxCtsDcs, "ctsdcs"); // strTxCtsDcs (string) 05 – D754I
    let busyLock_AB = this.getU32(this.busyLock); // busyLock 01 00 00 00 (0-Off,1-On)
    let txPower_AB = this.getU32(this.txPower); // txPower 01 00 00 00 (0-H,1-L)
    let bandwide_AB = this.getU32(this.bandwide); // bandwide 01 00 00 00 (0-W,1-N)
    let scanAdd_AB = this.getU32(this.scanAdd); // scanAdd 01 00 00 00 (0-Del,1-Add)
    let sqMode_AB = this.getU32(this.sqMode); // sqMode 02 00 00 00 (0-SQ-DQT,1- SQ-DQT*DTMF,2- SQ-DQT+DTMF)
    let pttid_AB = this.getU32(this.pttid); // pttid 03 00 00 00 (0-Off,1-BOT,2-EOT,3-Both)
    let signalGroup_AB = this.getU32(this.signalGroup); // signalGroup 13 00 00 00 (0-19 = 1-20)
    let fhss_AB = this.getU32(this.fhss); // fhss 01 00 00 00 (0-Off,1-On)
    let cName_AB = this.bytesFromString(this.cName, "name"); // name (String) 04 - NAME

    //get buffer size
    let bufferSize = 13;
    bufferSize += rxFreq_AB.byteLength;
    bufferSize += strRxCtsDcs_AB.byteLength;
    bufferSize += txFreq_AB.byteLength;
    bufferSize += strTxCtsDcs_AB.byteLength;
    bufferSize += 32; // all 4 byte values total
    bufferSize += cName_AB.byteLength;

    //create buffer
    let index = 0;
    let buffer = new Uint8Array(bufferSize);

    for (var i = 0; i < 13; i++) {
      buffer[index] = id_AB[i];
      index += 1;
    }

    for (var i = 0; i < rxFreq_AB.byteLength; i++) {
      buffer[index] = rxFreq_AB[i];
      index += 1;
    }

    for (var i = 0; i < strRxCtsDcs_AB.byteLength; i++) {
      buffer[index] = strRxCtsDcs_AB[i];
      index += 1;
    }

    for (var i = 0; i < txFreq_AB.byteLength; i++) {
      buffer[index] = txFreq_AB[i];
      index += 1;
    }

    for (var i = 0; i < strTxCtsDcs_AB.byteLength; i++) {
      buffer[index] = strTxCtsDcs_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = busyLock_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = txPower_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = bandwide_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = scanAdd_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = sqMode_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = pttid_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = signalGroup_AB[i];
      index += 1;
    }

    for (var i = 0; i < 4; i++) {
      buffer[index] = fhss_AB[i];
      index += 1;
    }

    for (var i = 0; i < cName_AB.byteLength; i++) {
      buffer[index] = cName_AB[i];
      index += 1;
    }

    //return buffer
    this.chanIndex += 1;
    return buffer;
  }

  formatFreq(freq) {
    freq = String(freq).trim();
    let size = freq.length;

    if (size > 9) {
      freq = freq.slice(0, 9);
    } else if (size < 9) {
      for (var i = size; i < 9; i++) {
        freq = freq + "0";
      }
    }
    //TODO add format
    return freq;
  }

  createID() {
    let id_AB = new ArrayBuffer(13);
    // Set id
    id_AB[0] = 0x01;

    let index_buf = new Uint16Array(1);
    index_buf[0] = this.chanIndex;

    id_AB[1] = index_buf[0] & 0xff;
    id_AB[2] = (index_buf[0] >> 8) & 0xff;

    id_AB[5] = 0x2e;

    return id_AB;
  }

  getU32(val) {
    let rVal = new Uint8Array(4);
    rVal[0] = val;

    return rVal;
  }

  bytesFromString(str, type) {
    let strBytes;

    str = String(str);

    if (str.length == 0) {
      if (type == "freq" || type == "name") {
        //Empty strings default to this
        strBytes = new ArrayBuffer(5);
        //09 AF 00 00
        strBytes[0] = 0x09;
        strBytes[1] = 0xa1;
        strBytes[2] = 0x04;
        strBytes[3] = 0x00;
        strBytes[4] = 0x00;

        this.strIndex += 1;
        return strBytes;
      } else {
        //Empty strings default to this
        strBytes = new ArrayBuffer(5 /*  */);
        //09 AF 00 00
        strBytes[0] = 0x09;
        strBytes[1] = 0xaf;
        strBytes[2] = 0x00;
        strBytes[3] = 0x00;
        strBytes[4] = 0x00;

        this.strIndex += 1;
        return strBytes;
      }
    } else {
      strBytes = new ArrayBuffer(str.length + 6);
      strBytes[0] = 0x06;

      let index_buf = new Uint16Array(1);
      index_buf[0] = this.strIndex;

      strBytes[1] = index_buf[0] & 0xff;
      strBytes[2] = (index_buf[0] >> 8) & 0xff;

      strBytes[5] = str.length;

      for (var i = 6; i < str.length + 6; i++) {
        strBytes[i] = str.charCodeAt(i - 6);
      }

      this.strIndex += 1;

      return strBytes;
    }
  }

  isEmpty() {
    if (
      this.txFreq.trim() == "" &&
      this.rxFreq.trim() == "" &&
      this.strTxCtsDcs.trim() == "" &&
      this.strRxCtsDcs.trim() == "" &&
      this.cName.trim() == ""
    ) {
      return true;
    } else {
      return false;
    }
  }
}

class Zone {
  channels = [];
  maxChannels = 100;

  constructor(channels = [], maxChannels = 100) {
    this.channels = channels;
    this.maxChannels = maxChannels;
  }

  addChannel(chan) {
    if (this.channels.length < this.maxChannels) {
      this.channels.push(chan);
    }
  }

  removeChannel(index) {
    delete this.channels[index];
  }

  getChannel(index) {
    if (index < this.channels.length) {
      return this.channels[index];
    } else {
      return new UV17Channel();
    }
  }

  getChannelCount() {
    return this.channels.length;
  }
}

