function writeDAT() {
  const response = confirm(".dat file will be saved to downloads");

  if (response) {
    const fileName = prompt("Enter file name");

    let ccIndexes = getcsvIndexes();
    let ccList = getcsvList();

    let ab = [];

    let head = genertateDatHead();
    ab.push(head);

    let chanIndex = 185;
    let strIndex = 1738;

    for (var i = 0; i < 1000; i++) {
      let c = new UV17Channel(chanIndex, strIndex);

      if (i < ccList.length) {
        let cc = new ChirpChannel(ccIndexes, ccList[i]);
        c.loadFromChirpChannel(cc);
      }

      let cb = c.getChannelBuffer();
      ab.push(cb);
      console.log(cb);

      chanIndex = c.chanIndex;
      strIndex = c.strIndex;
    }

    //Close program
    let close = new Uint8Array([0x0b]);
    ab.push(close);

    writeFile(ab, fileName + ".dat");
  }
}

function importData() {
  let input = document.createElement("input");
  input.type = "file";
  input.onchange = (_) => {
    var file = input.files[0];
    if (file.name.match(/\.(txt|csv)$/)) {
      var reader = new FileReader();
      reader.onload = function (progressEvent) {
        var csvList = reader.result.split("\n");
        //for (var row = 0; row < csvList.length; row++) {
        //console.log(csvList[row]);
        //}
        //set first line as indexes
        storecsvIndexes(csvList[0]);
        //Remove first line and store list
        storecsvList(csvList.splice(1));
      };
      reader.readAsText(file);
    } else {
      alert("File not supported, .txt or .csv files only");
    }
  };

  input.click();
}

function writeFile(buffers, fileName) {
  var file = new Blob(buffers, {
    type: "application/octet-binary;charset=utf-8",
  });
  var a = document.createElement("a"),
    url = URL.createObjectURL(file);
  a.href = url;
  a.download = fileName;
  document.body.appendChild(a);
  a.click();
}

function storecsvIndexes(line) {
  let values = line.split(",");
  localStorage.csvIndexes = JSON.stringify(values);
}

function getcsvIndexes() {
  return JSON.parse(localStorage.getItem("csvIndexes"));
}

function storecsvList(list) {
  let csvList = [];

  for (i = 0; i < list.length; i++) {
    let line = list[i];
    let values = line.split(",");
    csvList.push(values);
  }

  localStorage.csvList = JSON.stringify(csvList);
}

function getChirpChannel(index) {
  let ccIndexes = getcsvIndexes();
  let ccList = getcsvList();

  return new ChirpChannel(ccIndexes, ccList[index]);
}

function getChirpChannelCount() {
  return getcsvList().length;
}

function getcsvList() {
  return JSON.parse(localStorage.getItem("csvList"));
}
